d; n = internalIn.read(bom, 0, bom.length); //读掉头部字节 //下面进行匹配 if ( (bom[0] == (byte)0x00) && (bom[1] == (byte)0x00) && (bom[2] == (byte)0xFE) && (bom[3] == (byte)0xFF) ) { encoding = \"UTF-32BE\"; unread = n - 4; } else if ( (bom[0] == (byte)0xFF) && (bom[1] == (byte)0xFE) && (bom[2] == (byte)0x00) && (bom[3] == (byte)0x00) ) { encoding = \"UTF-32LE\"; unread = n - 4; } else if ( (bom[0] == (byte)0xEF) && (bom[1] == (byte)0xBB) && (bom[2] == (byte)0xBF) ) { encoding = \"UTF-8\"; unread = n - 3; } else if ( (bom[0] == (byte)0xFE) && (bom[1] == (byte)0xFF) ) { encoding = \"UTF-16BE\"; unread = n - 2; } else if ( (bom[0] == (byte)0xFF) && (bom[1] == (byte)0xFE) ) { encoding = \"UTF-16LE\"; unread = n - 2; } else { // Unicode BOM mark not found, unread all bytes encoding = defaultEnc; unread = n; } //System.out.println(\"read=\" + n + \", unread=\" + unread); // 回退 if (unread > 0) internalIn.unread(bom, (n - unread), unread); isInited = true;\n}","breadcrumbs":"Stream » stream-utf-bom » BOMInputStream","id":"12","title":"BOMInputStream"},"13":{"body":"","breadcrumbs":"Stream » stream-utf-bom » BOMInputStream","id":"13","title":"BOMInputStream"},"14":{"body":"","breadcrumbs":"Stream » stream-utf-bom » BOMInputStream","id":"14","title":"BOMInputStream"},"15":{"body":"面向切面编程","breadcrumbs":"AOP » Aspect Oriented Programming","id":"15","title":"Aspect Oriented Programming"},"16":{"body":"java-tag-amF2YS10YWc= JDK-Proxy 必须先定义接口 @CallerSensitive public static Object newProxyInstance(ClassLoader loader, //目标类的loader Class<?>[] interfaces, //接口类数组 InvocationHandler h){ //执行代理方法 //more } //在 InvocationHandler 里 可以在自定义切面方法 // like :before after Cglib-Proxy 无需接口，通过asm直接加载字节码生成子类 Enhancer enhancer = new Enhancer(); enhancer.setSuperclass(target.getClass()); enhancer.setCallback( // impl MethodInterceptor ); enhancer.create(); 上面的cglib实现用到了import net.sf.cglib.proxy.MethodInterceptor;import net.sf.cglib.proxy.MethodProxy; 如果在spring环境下也可以 用 import org.springframework.cglib.proxy.MethodInterceptor;import org.springframework.cglib.proxy.MethodProxy;","breadcrumbs":"AOP » java-proxy » java-proxy","id":"16","title":"java-proxy"},"17":{"body":"Bloom Filter Counting Bloom Filter Bloom Filters - the math Bloom_filter-wikipedia","breadcrumbs":"bloomfilter » Bloom Filter","id":"17","title":"Bloom Filter"},"18":{"body":"hash算法的选择 bit数组的实现","breadcrumbs":"bloomfilter » java-bloomfilter » java-bloomfilter","id":"18","title":"java-bloomfilter"},"19":{"body":"cache","breadcrumbs":"cache » cache","id":"19","title":"cache"},"2":{"body":"sqlx-rs","breadcrumbs":"Sqlx » SQLX","id":"2","title":"SQLX"},"20":{"body":"先进先出策略 容量固定 没有过期项目时，先remove先存入的缓存。 使用链表实现时存入与清除速度快 缓存丢弃优先级 时间>位置（存入顺序） LRU（LeastRecentlyUsed） 容量固定 没有过期项目时优先remove最早访问的项 每次访问都把最新访问的项移动到头部 缓存丢弃优先级 时间>最后访问时间 最小访问频率LFU(least frequently used) 容量固定 每次访问时根据访问频率排序 缓存丢弃优先级 时间>访问频率 LRU-2[2, 3] 根据倒数最后2次的时间进行比较排序 记录缓存项目最后2次的时间 丢弃缓存时优先丢弃倒数最后第二次访问时间距今最长的项","breadcrumbs":"cache » cache-policy » cache-policy","id":"20","title":"cache-policy"},"21":{"body":"verification-random","breadcrumbs":"verification-random » verification-random","id":"21","title":"verification-random"},"22":{"body":"所以，current根据当前线程获得random实例 /** * Returns the current thread's {@code ThreadLocalRandom}. * * @return the current thread's {@code ThreadLocalRandom} */ public static ThreadLocalRandom current() { if (U.getInt(Thread.currentThread(), PROBE) == 0) localInit(); return instance; } 在初始化时 ，seed与唯一线程一一对应 即每一线程有自己的seed 如果取不到自己的seed，就会造成不同线程使用同一seed /** * Initialize Thread fields for the current thread. Called only * when Thread.threadLocalRandomProbe is zero, indicating that a * thread local seed value needs to be generated. Note that even * though the initialization is purely thread-local, we need to * rely on (static) atomic generators to initialize the values. */ static final void localInit() { int p = probeGenerator.addAndGet(PROBE_INCREMENT); int probe = (p == 0) ? 1 : p; // skip 0 long seed = mix64(seeder.getAndAdd(SEEDER_INCREMENT)); Thread t = Thread.currentThread(); U.putLong(t, SEED, seed); U.putInt(t, PROBE, probe); } 最后 ，不同线程使用统同一算法、同一seed便会出现相同的随机数","breadcrumbs":"verification-random » ThreadLocalRandom » ThreadLocalRandom","id":"22","title":"ThreadLocalRandom"},"23":{"body":"","breadcrumbs":"verification-random » ThreadLocalRandom » Graphics2D","id":"23","title":"Graphics2D"},"24":{"body":"用于实现验证码 BufferedImage image = new BufferedImage(1, 1, BufferedImage.TYPE_INT_ARGB); Graphics2D graphics2d = image.createGraphics();","breadcrumbs":"verification-random » ThreadLocalRandom » java-graphic","id":"24","title":"java-graphic"},"25":{"body":"Scheduler","breadcrumbs":"scheduler » Scheduler","id":"25","title":"Scheduler"},"26":{"body":"定时器 执行器 监听进程 任务集合 执行线程池","breadcrumbs":"scheduler » what-does-scheduler-need » 一个任务调度器需要什么？","id":"26","title":"一个任务调度器需要什么？"},"27":{"body":"crontab: usage error: unrecognized option usage:\tcrontab [-u user] file crontab [ -u user ] [ -i ] { -e | -l | -r } (default operation is replace, per 1003.2) -e\t(edit user's crontab) -l\t(list user's crontab) -r\t(delete user's crontab) -i\t(prompt before deleting user's crontab) f1 f2 f3 f4 f5 program * * * * *\n- - - - -\n| | | | |\n| | | | +----- 星期中星期几 (0 - 7) (星期天 为0)\n| | | +---------- 月份 (1 - 12) | | +--------------- 一个月中的第几天 (1 - 31)\n| +-------------------- 小时 (0 - 23)\n+------------------------- 分钟 (0 - 59)","breadcrumbs":"scheduler » what-does-scheduler-need » crontab","id":"27","title":"crontab"},"28":{"body":"加密、解密 symmetric asymmetric digest","breadcrumbs":"security » security","id":"28","title":"security"},"29":{"body":"java-standard-加密算法 Cipher c = Cipher.getInstance(\"AES/CBC/PKCS5Padding\"); cipher.init(Cipher.ENCRYPT_MODE, secretKey, params); cipher.doFinal(base64content)","breadcrumbs":"security » java-security » java-security","id":"29","title":"java-security"},"3":{"body":"rust-tag-cnVzdC10YWc= sqlx::query let mut conn = new::<Any>().await?; let value = sqlx::query(\"select 1 + 5\") .try_map(|row: AnyRow| row.try_get::<i32, _>(0)) .fetch_one(&mut conn) .await?; assert_eq!(6i32, value); conn.close().await?; Ok(()) ping let mut conn = new::<Any>().await?; conn.ping().await?; Ok(()) pool fetch_all let pool = sqlx_test::pool::<Any>().await?; let rows = pool.fetch_all(\"SELECT 1; SElECT 2\").await?; assert_eq!(rows.len(), 2); Ok(()) fail and recover let mut conn = new::<Any>().await?; for i in 0..10 { // make a query that will fail let res = conn .execute(\"INSERT INTO not_found (column) VALUES (10)\") .await; assert!(res.is_err()); // now try and use the connection let val: i32 = conn .fetch_one(&*format!(\"SELECT {}\", i)) .await? .get_unchecked(0); assert_eq!(val, i); } Ok(()) Make a SQL query that is mapped to a concrete type use FromRow in my opinion , rust not usually used reflections but use a lot of macro and trait pub trait FromRow<'r, R: Row>: Sized { fn from_row(row: &'r R) -> Result<Self, Error>;\n} then ,we can use #[derive(sqlx::FromRow)]","breadcrumbs":"Sqlx » sqlx-rs » sqlx rust","id":"3","title":"sqlx rust"},"30":{"body":"SM2Engine engine = new SM2Engine(digest, mode); engine.processBlock(data, 0, length);","breadcrumbs":"security » java-security » SM2","id":"30","title":"SM2"},"31":{"body":"sqldriver","breadcrumbs":"sqldriver » sqldriver","id":"31","title":"sqldriver"},"32":{"body":"table info TABLE_CAT String => table catalog (may be null) TABLE_SCHEM String => table schema (may be null) TABLE_NAME String => table name TABLE_TYPE String => table type. Typical types are \"TABLE\", \"VIEW\", \"SYSTEM TABLE\", \"GLOBAL TEMPORARY\", \"LOCAL TEMPORARY\", \"ALIAS\", \"SYNONYM\". REMARKS String => explanatory comment on the table TYPE_CAT String => the types catalog (may be null) TYPE_SCHEM String => the types schema (may be null) TYPE_NAME String => type name (may be null) SELF_REFERENCING_COL_NAME String => name of the designated \"identifier\" column of a typed table (may be null) REF_GENERATION String => specifies how values in SELF_REFERENCING_COL_NAME are created. Values are \"SYSTEM\", \"USER\", \"DERIVED\". (may be null) Connection connection=dataSource.getConnection();\nDatabaseMetaData metadata= connection.getMetaData();\nmetadata.getTables(String catalog, String schemaPattern, String tableNamePattern, String[] types); Columns info TABLE_CAT String => table catalog (may be null) TABLE_SCHEM String => table schema (may be null) TABLE_NAME String => table name COLUMN_NAME String => column name DATA_TYPE int => SQL type from java.sql.Types TYPE_NAME String => Data source dependent type name, for a UDT the type name is fully qualified COLUMN_SIZE int => column size. BUFFER_LENGTH is not used. DECIMAL_DIGITS int => the number of fractional digits. Null is returned for data types where DECIMAL_DIGITS is not applicable. NUM_PREC_RADIX int => Radix (typically either 10 or 2) NULLABLE int => is NULL allowed. columnNoNulls - might not allow NULL values columnNullable - definitely allows NULL values columnNullableUnknown - nullability unknown REMARKS String => comment describing column (may be null) COLUMN_DEF String => default value for the column, which should be interpreted as a string when the value is enclosed in single quotes (may be null) SQL_DATA_TYPE int => unused SQL_DATETIME_SUB int => unused CHAR_OCTET_LENGTH int => for char types the maximum number of bytes in the column ORDINAL_POSITION int => index of column in table (starting at 1) IS_NULLABLE String => ISO rules are used to determine the nullability for a column. YES --- if the column can include NULLs NO --- if the column cannot include NULLs empty string --- if the nullability for the column is unknown SCOPE_CATALOG String => catalog of table that is the scope of a reference attribute (null if DATA_TYPE isn't REF) SCOPE_SCHEMA String => schema of table that is the scope of a reference attribute (null if the DATA_TYPE isn't REF) SCOPE_TABLE String => table name that this the scope of a reference attribute (null if the DATA_TYPE isn't REF) SOURCE_DATA_TYPE short => source type of a distinct type or user-generated Ref type, SQL type from java.sql.Types (null if DATA_TYPE isn't DISTINCT or user-generated REF) IS_AUTOINCREMENT String => Indicates whether this column is auto incremented YES --- if the column is auto incremented NO --- if the column is not auto incremented empty string --- if it cannot be determined whether the column is auto incremented IS_GENERATEDCOLUMN String => Indicates whether this is a generated column YES --- if this a generated column NO --- if this not a generated column empty string --- if it cannot be determined whether this is a generated column ResultSet rs = metaData.getColumns(catalog, schema, tableNamePattern, String columnNamePattern) TABLE_CAT String => table catalog (may be null) TABLE_SCHEM String => table schema (may be null) TABLE_NAME String => table name COLUMN_NAME String => column name KEY_SEQ short => sequence number within primary key( a value of 1 represents the first column of the primary key, a value of 2 would represent the second column within the primary key). PK_NAME String => primary key name (may be null) ResultSet rs = metaData.getPrimaryKeys(catalog, schema, tableName)","breadcrumbs":"sqldriver » db mate info » db mate info","id":"32","title":"db mate info"},"33":{"body":"datafeature","breadcrumbs":"datafeature » datafeature","id":"33","title":"datafeature"},"34":{"body":"DFA参考 DFA是一个含5个元素的元祖(S, q0, T, F, Σ) S：状态的集合 q0：初始化状态 T：状态的转化路径 F：结束状态的集合 Σ：全部的字母表 基于DFA的特性，可以构建词法树。","breadcrumbs":"datafeature » deterministic-finite-automaton » deterministic-finite-automaton","id":"34","title":"deterministic-finite-automaton"},"35":{"body":"位运算 参考 http://graphics.stanford.edu/~seander/bithacks.html","breadcrumbs":"bit & ^ » bit运算","id":"35","title":"bit运算"},"36":{"body":"https://labuladong.gitee.io/algo/%E7%AE%97%E6%B3%95%E6%80%9D%E7%BB%B4%E7%B3%BB%E5%88%97/%E5%B8%B8%E7%94%A8%E7%9A%84%E4%BD%8D%E6%93%8D%E4%BD%9C.html 利用或操作 | 和空格将英文字符转换为小写 ('a' | ' ') = 'a'\n('A' | ' ') = 'a' 利用与操作 & 和下划线将英文字符转换为大写 ('b' & '_') = 'B'\n('B' & '_') = 'B' 利用异或操作 ^ 和空格进行英文字符大小写互换 ('d' ^ ' ') = 'D'\n('D' ^ ' ') = 'd' 判断两个数是否异号 int x = -1, y = 2;\nbool f = ((x ^ y) < 0); // true int x = 3, y = 2;\nbool f = ((x ^ y) < 0); // false 不用临时变量交换两个数 int a = 1, b = 2;\na ^= b;\nb ^= a;\na ^= b;\n// 现在 a = 2, b = 1 加一 int n = 1;\nn = -~n;\n// 现在 n = 2 减一 int n = 2;\nn = ~-n;\n// 现在 n = 1 8 . 就是让你返回 n 的二进制表示中有几个 1。因为 n & (n - 1) 可以消除最后一个 1，所以可以用一个循环不停地消除 1 同时计数，直到 n 变成 0 为止。 int hammingWeight(uint32_t n) { int res = 0; while (n != 0) { n = n & (n - 1); res++; } return res;\n} 判断一个数是不是 2 的指数 一个数如果是 2 的指数，那么它的二进制表示一定只含有一个 1： 2^0 = 1 = 0b0001\n2^1 = 2 = 0b0010\n2^2 = 4 = 0b0100 ** 如果使用 n&(n-1) 的技巧就很简单了（注意运算符优先级，括号不可以省略）：** bool isPowerOfTwo(int n) { if (n <= 0) return false; return (n & (n - 1)) == 0;\n} 一个数和它本身做异或运算结果为 0，即 a ^ a = 0；一个数和 0 做异或运算的结果为它本身，即 a ^ 0 = a。 对于这道题目，我们只要把所有数字进行异或，成对儿的数字就会变成 0，落单的数字和 0 做异或还是它本身，所以最后异或的结果就是只出现一次的元素： int singleNumber(vector<int>& nums) { int res = 0; for (int n : nums) { res ^= n; } return res;\n}","breadcrumbs":"bit & ^ » base » 基本运算","id":"36","title":"基本运算"},"37":{"body":"待业中 邮箱：realcpf@163.com","breadcrumbs":"About » README","id":"37","title":"README"},"4":{"body":"rust-tag-cnVzdC10YWc= Query /// Raw SQL query with bind parameters. Returned by [`query`][crate::query::query].\n#[must_use = \"query must be executed to affect database\"]\npub struct Query<'q, DB: Database, A> { pub(crate) statement: Either<&'q str, &'q <DB as HasStatement<'q>>::Statement>, pub(crate) arguments: Option<A>, pub(crate) database: PhantomData<DB>, pub(crate) persistent: bool,\n} /// Make a SQL query.\npub fn query<DB>(sql: &str) -> Query<'_, DB, <DB as HasArguments<'_>>::Arguments>\nwhere DB: Database,\n{ Query { //Zero-sized type used to mark things that \"act like\" they own a T. //Adding a PhantomData<T> field to your type tells the compiler that //your type acts as though it stores a value of type T, even though it doesn't really. //This information is used when computing certain safety properties. database: PhantomData, arguments: Some(Default::default()), //The enum Either with variants Left and Right is a general purpose sum type with two cases. //The Either type is symmetric and treats its variants the same way, without preference. //(For representing success or error, use the regular Result enum instead.) statement: Either::Left(sql), persistent: true, }\n} try_map # impl<'q, DB, A: Send> Query<'q, DB, A>\n# where\n# DB: Database,\n# A: 'q + IntoArguments<'q, DB>,\n# { /// Map each row in the result to another type. /// /// See [`try_map`](Query::try_map) for a fallible version of this method. /// /// The [`query_as`](super::query_as::query_as) method will construct a mapped query using /// a [`FromRow`](super::from_row::FromRow) implementation. #[inline] pub fn map<F, O>(self, f: F) -> Map<'q, DB, impl TryMapRow<DB, Output = O>, A> where F: MapRow<DB, Output = O>, O: Unpin, { self.try_map(MapRowAdapter(f)) }\n# } fetch_one # impl<'q, DB, A: Send> Query<'q, DB, A>\n# where\n# DB: Database,\n# A: 'q + IntoArguments<'q, DB>,\n# { /// Execute the query and returns exactly one row. pub async fn fetch_one<'e, 'c: 'e, E>(self, executor: E) -> Result<O, Error> where 'q: 'e, E: 'e + Executor<'c, Database = DB>, DB: 'e, F: 'e, O: 'e, { self.fetch_optional(executor) .and_then(|row| match row { Some(row) => future::ok(row), None => future::err(Error::RowNotFound), }) .await } /// Execute the query and returns at most one row. pub async fn fetch_optional<'e, 'c: 'e, E>(mut self, executor: E) -> Result<Option<O>, Error> where 'q: 'e, E: 'e + Executor<'c, Database = DB>, DB: 'e, F: 'e, O: 'e, { // executor.fetch_optional need impl with target db like let row = executor.fetch_optional(self.inner).await?; pg、mysql、sqlite if let Some(row) = row { self.mapper.try_map_row(row).map(Some) } else { Ok(None) } }\n# } fetch_optional fn fetch_optional<'e, 'q: 'e, E: 'q>( self, mut query: E, ) -> BoxFuture<'e, Result<Option<AnyRow>, Error>> where 'c: 'e, E: Execute<'q, Self::Database>, { let arguments = query.take_arguments(); let query = query.sql(); Box::pin(async move { Ok(match &mut self.0 { #[cfg(feature = \"postgres\")] AnyConnectionKind::Postgres(conn) => conn .fetch_optional((query, arguments.map(Into::into))) .await? .map(Into::into), #[cfg(feature = \"mysql\")] AnyConnectionKind::MySql(conn) => conn .fetch_optional((query, arguments.map(Into::into))) .await? .map(Into::into), #[cfg(feature = \"sqlite\")] AnyConnectionKind::Sqlite(conn) => conn .fetch_optional((query, arguments.map(Into::into))) .await? .map(Into::into), #[cfg(feature = \"mssql\")] AnyConnectionKind::Mssql(conn) => conn .fetch_optional((query, arguments.map(Into::into))) .await? .map(Into::into), }) }) } map_row # #[allow(unused_macros)]\nmacro_rules! impl_map_row { ($DB:ident, $R:ident) => { impl<O: Unpin, F> crate::query::MapRow<$DB> for F where F: Send + FnMut($R) -> O, { type Output = O; fn map_row(&mut self, row: $R) -> O { (self)(row) } } impl<O: Unpin, F> crate::query::TryMapRow<$DB> for F where F: Send + FnMut($R) -> Result<O, crate::error::Error>, { type Output = O; fn try_map_row(&mut self, row: $R) -> Result<O, crate::error::Error> { (self)(row) } } };\n}","breadcrumbs":"Sqlx » query::Query » query::Query","id":"4","title":"query::Query"},"5":{"body":"rust-tag-cnVzdC10YWc=\nwith pg // this impl under pg fn ping(&mut self) -> BoxFuture<'_, Result<(), Error>> { // By sending a comment we avoid an error if the connection was in the middle of a rowset self.execute(\"/* SQLx ping */\").map_ok(|_| ()).boxed() } // under Any db fn ping(&mut self) -> BoxFuture<'_, Result<(), Error>> { delegate_to_mut!(self.ping()) } delegate_to_mut! macro_rules! delegate_to_mut { ($self:ident.$method:ident($($arg:ident),*)) => { match &mut $self.0 { #[cfg(feature = \"postgres\")] AnyConnectionKind::Postgres(conn) => conn.$method($($arg),*), #[cfg(feature = \"mysql\")] AnyConnectionKind::MySql(conn) => conn.$method($($arg),*), #[cfg(feature = \"sqlite\")] AnyConnectionKind::Sqlite(conn) => conn.$method($($arg),*), #[cfg(feature = \"mssql\")] AnyConnectionKind::Mssql(conn) => conn.$method($($arg),*), } };\n}","breadcrumbs":"Sqlx » ping » ping","id":"5","title":"ping"},"6":{"body":"rust-tag-cnVzdC10YWc= # pub trait Executor<'c>: Send + Debug + Sized {\n# type Database: Database; /// Execute the query and return all the generated results, collected into a [`Vec`]. fn fetch_all<'e, 'q: 'e, E: 'q>( self, query: E, ) -> BoxFuture<'e, Result<Vec<<Self::Database as Database>::Row>, Error>> where 'c: 'e, E: Execute<'q, Self::Database>, { self.fetch(query).try_collect().boxed() } /// Execute the query and return the generated results as a stream. fn fetch<'e, 'q: 'e, E: 'q>( self, query: E, ) -> BoxStream<'e, Result<<Self::Database as Database>::Row, Error>> where 'c: 'e, E: Execute<'q, Self::Database>, { self.fetch_many(query) .try_filter_map(|step| async move { Ok(match step { Either::Left(_) => None, Either::Right(row) => Some(row), }) }) .boxed() } # } fetch_many with AnyConnection # impl<'c> Executor<'c> for &'c mut AnyConnection {\n# type Database = Any; fn fetch_many<'e, 'q: 'e, E: 'q>( self, mut query: E, ) -> BoxStream<'e, Result<Either<AnyDone, AnyRow>, Error>> where 'c: 'e, E: Execute<'q, Self::Database>, { let arguments = query.take_arguments(); let query = query.sql(); match &mut self.0 { #[cfg(feature = \"postgres\")] AnyConnectionKind::Postgres(conn) => conn .fetch_many((query, arguments.map(Into::into))) .map_ok(|v| v.map_right(Into::into).map_left(Into::into)) .boxed(), #[cfg(feature = \"mysql\")] AnyConnectionKind::MySql(conn) => conn .fetch_many((query, arguments.map(Into::into))) .map_ok(|v| v.map_right(Into::into).map_left(Into::into)) .boxed(), #[cfg(feature = \"sqlite\")] AnyConnectionKind::Sqlite(conn) => conn .fetch_many((query, arguments.map(Into::into))) .map_ok(|v| v.map_right(Into::into).map_left(Into::into)) .boxed(), #[cfg(feature = \"mssql\")] AnyConnectionKind::Mssql(conn) => conn .fetch_many((query, arguments.map(Into::into))) .map_ok(|v| v.map_right(Into::into).map_left(Into::into)) .boxed(), } }\n# } fetch_many with PgConnection # impl<'c> Executor<'c> for &'c mut PgConnection {\n# type Database = Postgres; fn fetch_many<'e, 'q: 'e, E: 'q>( self, mut query: E, ) -> BoxStream<'e, Result<Either<PgDone, PgRow>, Error>> where 'c: 'e, E: Execute<'q, Self::Database>, { let sql = query.sql(); let metadata = query.statement().map(|s| Arc::clone(&s.metadata)); let arguments = query.take_arguments(); let persistent = query.persistent(); Box::pin(try_stream! { let s = self.run(sql, arguments, 0, persistent, metadata).await?; pin_mut!(s); while let Some(v) = s.try_next().await? { r#yield!(v); } Ok(()) }) }\n# } try_stream! macro_rules! try_stream { ($($block:tt)*) => { crate::ext::async_stream::TryAsyncStream::new(move |mut sender| async move { macro_rules! r#yield { ($v:expr) => { let _ = futures_util::sink::SinkExt::send(&mut sender, Ok($v)).await; } } $($block)* }) }\n}","breadcrumbs":"Sqlx » fetch_all » sqlx-fetch_all","id":"6","title":"sqlx-fetch_all"},"7":{"body":"rust-tag-cnVzdC10YWc=\n[FromRow](https://github.com/launchbadge/sqlx/blob/c7cf104a8f6c0e61c2a72bf9631a0f079e0e94f4/sqlx-core/src/from_row.rs#L4)\n--- A record that can be built from a row returned by the database. In order to use query_as the output type must implement FromRow.","breadcrumbs":"Sqlx » FromRow » sqlx-fromrow","id":"7","title":"sqlx-fromrow"},"8":{"body":"This trait can be derived by SQLx for any struct. The generated implementation will consist of a sequence of calls to Row::try_get using the name from each struct field. #[derive(sqlx::FromRow)]\nstruct User { id: i32, name: String,\n}","breadcrumbs":"Sqlx » FromRow » Derivable","id":"8","title":"Derivable"},"9":{"body":"Several attributes can be specified to customize how each column in a row is read: rename When the name of a field in Rust does not match the name of its corresponding column, you can use the rename attribute to specify the name that the field has in the row. For example: #[derive(sqlx::FromRow)]\nstruct User { id: i32, name: String, #[sqlx(rename = \"description\")] about_me: String\n} Given a query such as: SELECT id, name, description FROM users; will read the content of the column description into the field about_me. rename_all By default, field names are expected verbatim (with the exception of the raw identifier prefix r#, if present). Placed at the struct level, this attribute changes how the field name is mapped to its SQL column name: #[derive(sqlx::FromRow)]\n#[sqlx(rename_all = \"camelCase\")]\nstruct UserPost { id: i32, // remapped to \"userId\" user_id: i32, contents: String\n} The supported values are snake_case (available if you have non-snake-case field names for some reason), lowercase, UPPERCASE, camelCase, PascalCase, SCREAMING_SNAKE_CASE and kebab-case. The styling of each option is intended to be an example of its behavior. default When your struct contains a field that is not present in your query, if the field type has an implementation for [Default], you can use the default attribute to assign the default value to said field. For example: #[derive(sqlx::FromRow)]\nstruct User { id: i32, name: String, #[sqlx(default)] location: Option<String>\n} Given a query such as: SELECT id, name FROM users; will set the value of the field location to the default value of Option<String>, which is None.","breadcrumbs":"Sqlx » FromRow » Field attributes","id":"9","title":"Field attributes"}},"length":38,"save":true},"fields":["title","body","breadcrumbs"],"index":{"body":{"root":{"0":{".":{".":{"1":{"0":{"df":1,"docs":{"3":{"tf":1.0}}},"df":0,"docs":{}},"df":0,"docs":{}},"df":0,"docs":{}},"0":{"df":1,"docs":{"12":{"tf":2.0}}},"b":{"0":{"0":{"0":{"1":{"df":1,"docs":{"36":{"tf":1.0}}},"df":0,"docs":{}},"1":{"0":{"df":1,"docs":{"36":{"tf":1.0}}},"df":0,"docs":{}},"df":0,"docs":{}},"1":{"0":{"0":{"df":1,"docs":{"36":{"tf":1.0}}},"df":0,"docs":{}},"df